  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Big Stone NWR
  outlines Refuge accomplishments during the 1979 calendar year. The report begins
  with an introduction to the Refuge and information about weather conditions, habitat
  conditions, and the system status. Construction, maintenance, and wildfires are
  also described. Habitat management is covered; croplands, grasslands, and wetlands
  are discussed. The wildlife section of the report discusses endangered and threatened
  species, migratory birds, mammals, and non-migratory birds. Interpretation and recreation
  activities are outlined; topics include information and interpretation, recreation,
  and law enforcement. Field investigations, cooperative programs, items of interest,
  safety information, and Refuge brochures are attached.\",\n\t\"license_title\":
